import React from 'react';
import './App.css';

import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';

import ScreenHome from './ScreenHome';
import ScreenMyArticle from './ScreenMyArticles'
import ScreenSource from './ScreenSource'
import ScreenArticlesBySource from './ScreenArticlesBySource'



function App() {
  return (
    <Router>
      <Switch>
        <Route exact path='/' component={ScreenHome}></Route>
        <Route exact path='/screenMyArticles' component={ScreenMyArticle}></Route>
        <Route exact path='/screenSource' component={ScreenSource}></Route>
        <Route exact path='/screenMyArticlesBySource' component={ScreenArticlesBySource}></Route>
      </Switch>
    </Router>
  );
}

export default App;
